import React from "react";
import { Operations_product } from "./Operations_product";

export const RowsName_product = (data) => {
  return (
    <tr key={Math.random()}>
      <td>{data.id}</td>
      <td>{data.title}</td>
      <td>{data.show_in_menu}</td>
      <td>{data.parent_id}</td>
      <td>{data.created_at}</td>
      {operation ? <Operations_product /> : null}
    </tr>
  );
};
